script: |
  super -f text -I q9750.spq | sort > q9750.out

inputs:
  - name: q9750.spq
    data: |
      SELECT DISTINCT - col1 - + col1 * - col0 * + col1 / 22 + col1 * + col2 + - CAST ( NULL AS REAL ) AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col1 / + col2 IS NOT NULL;
  - name: tab2

outputs:
  - name: q9750.out
    data: |
